import React from 'react';
import PropTypes from 'prop-types';

import OnionImage from "../images/onion.jpg"
import { Card,Button,ListGroup } from 'react-bootstrap';
const PostContent = props => {
    return (
        <Card style={{ width: '30rem' }}>
        <Card.Img variant="top" src={OnionImage} />
        <Card.Body>
          <Card.Title>Post Title</Card.Title>
          <Card.Text>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Morbi id pellentesque enim, ut volutpat felis. In a orci id leo malesuada varius. Vivamus varius fringilla diam, at commodo magna. Interdum et malesuada fames ac ante ipsum primis in faucibus. Sed id lorem non augue egestas venenatis at ut erat. Nam rhoncus a massa eget tincidunt. Donec mattis faucibus dolor sit amet porta. Morbi auctor massa vel consequat fringilla. Maecenas vel dolor eget elit blandit dictum id in ipsum. Aliquam erat volutpat. Donec tempus ligula vitae enim posuere sollicitudin. Praesent vulputate pharetra orci, quis aliquam arcu luctus et. Pellentesque neque eros, tincidunt nec maximus quis, facilisis et massa.

Sed lobortis dui a aliquam auctor. Integer eget nibh quis mauris fermentum ullamcorper ut non dui. Donec rhoncus orci a nisi elementum porta. Integer quis pellentesque nulla. Donec ullamcorper maximus felis. Nulla volutpat lorem in consequat suscipit. Nulla sit amet velit a nunc rutrum placerat. Quisque fringilla eu enim non mollis. In mattis sagittis dictum. Aenean in quam sed nisl luctus dictum. Morbi magna nisi, sollicitudin ac lacus id, mollis eleifend ligula. Integer sit amet eros turpis. Mauris vel risus sed magna venenatis commodo. Nam et suscipit sapien, in placerat nunc. Vestibulum nec posuere diam. Phasellus ac fermentum libero, ut condimentum tortor.
          </Card.Text>
        </Card.Body>
        <ListGroup className="list-group-flush">
          <ListGroup.Item>Price : $100</ListGroup.Item>
          <ListGroup.Item>Posted : 10 minutes ago</ListGroup.Item>
          <ListGroup.Item>@sjlee2016</ListGroup.Item>
        </ListGroup>
        <Card.Body>
          <Card.Link href="#">Card Link</Card.Link>
          <Card.Link href="#">Another Link</Card.Link>
        </Card.Body>
      </Card>
    );
};

PostContent.propTypes = {

};

export default PostContent;
